INSERT INTO `_perpus_berita` (`id`, `judul`, `konten`, `timestamp`, `publish`) VALUES
(1, 'Perpustakaan Menjadi Salah Satu Sarat Sekolah Standar', '<div class="konten"><div id="attachment_8298" style="width: 438px" class="wp-caption aligncenter"><a href="http://siapbelajar.com/wp-content/uploads/2013/08/perpustakaan-buku.jpg"><img class="size-full wp-image-8298" src="http://siapbelajar.com/wp-content/uploads/2013/08/perpustakaan-buku.jpg" alt="Ilustrasi. (Foto: Reuters)" width="428" height="299"></a><p class="wp-caption-text">Ilustrasi. (Foto: Reuters)</p></div>\r\n<p><strong>PERPUSTAKAAN </strong>sekolah ,emjadi salah satu sarat untuk sekolah standar. Untuk ityu pemerintah terus membangun perpustakaan di setiap sekolah. Perpustakaan sekolah yang dibangun di sejumlah sekolah di Ciamis, selain&nbsp; ruanganya nyaman juga buku-bukunya harus menarik minat baca para siswa.</p>\r\n<p>Demikian dikatakan Kepala Unit Pelaksana Teknis Dinas Pendidikan Kecamatan Cimaragas Asep Wahyu Kamis, (2/10/2014).</p>\r\n<p>“Saat ini sekolah yang ada&nbsp; belum semuanya memiliki gedung perpustakaan yang refresentatif,” ungkapnya.</p>\r\n<p>Selain pembangunan gedung perpustakaan pihak pemerintahpun lanjutnya berupaya untuk memenuhi persaratan&nbsp; sekolah standar.</p>\r\n<p>Asep menambahkan, agar standar terpenuhi, swekolah harus memenuhi 10 persyaratan.</p>\r\n<p>“Sepuluh persyaratan tersebut diantaranya kelengkapan semua administrasi dengan pengelolaan&nbsp; sistim online. Agar bisa mengakses informasi pendidikan secepatnya,” ujarnya.<strong>(fokusjabar.com)</strong></p>\r\n</div>', '2014-10-06 11:50:33', 1),
(2, 'Wali Kota Cimahi Ingin Perpustakaan Jadi Pusat Diskusi', '<div class="konten">\r\n				<div id="attachment_13046" style="width: 468px" class="wp-caption aligncenter"><a href="http://siapbelajar.com/wp-content/uploads/2014/05/Siswa-SD-perpustakaan.jpg"><img class="size-full wp-image-13046" alt="Ilustrasi:Siswa-siswi SD belajar di perpustakaan." src="http://siapbelajar.com/wp-content/uploads/2014/05/Siswa-SD-perpustakaan.jpg" width="458" height="294"></a><p class="wp-caption-text">Ilustrasi:Siswa-siswi SD belajar di perpustakaan.</p></div>\r\n<p><b style="line-height: 1.5em;">WALI</b><span style="line-height: 1.5em;"> Kota Cimahi Atty Suharti mengatakan keberadaan perpustakaan umum diharapkan dapat menjadi titik episentrum intelektualitas di Kota Cimahi, sebab perpustakaan itu bukan sekadar tempat untuk menyimpan buku dan arsip.</span></p>\r\n<p>“Perpustakaan menjadi pusat informasi, pusat kegiatan dan diskusi,” kata Wali Kota Cimahi saat meresmikan penggunaan Gedung Perpustakaan Umum Kota Cimahi di Jalan Daeng Muhammad Ardiwinata, Blok Jati-Cihanjuang, Minggu (15/6).</p>\r\n<p>Dalam peresmian tersebut, Wali Kota Cimahi menandatangani prasasti peremian dan menggunting pita sebagai tanda mulai digunakannya gedung perpustakaan yang lokasinya lebih strategis dibinding tempat sebelumnya yang berada di lingkungan Pemkot Cimahi.</p>\r\n<p>Menurut Atty, dengan diresmikannya penggunaan gedung Perpustakaan Umum Kota Cimahi, menjadi salah satu bukti kepedulian pemkot dalam menumbuhkan budaya gemar membaca melalui pengembangan dan pendayagunaan perpustakaan sebagai sumber informasi yang berisikan karya tulis, karya cetak, dan karya rekam di Kota Cimahi.</p>\r\n<p>“Sehingga diharapkan pula gedung perpustakaan yang baru dengan berbagai fasilitas penunjangnya yang cukup lengkap dapat menjadi pemicu untuk meningkatkan minat baca dan mempermudah akses terhadap buku bahan bacaan atau literatur lainnya bagi seluruh warga Cimahi,” katanya.</p>\r\n<p>Kepala Kantor Arsip, Perpustakaan dan Pengelolaan Data Elektronik Kota Cimahi, Chanifah Listyarini menambahkan bahwa Perpustakaan Umum Kota Cimahi akan terus berupaya untuk dapat memenuhi kebutuhan masyarakat. Beragamnya kebutuhan informasi masyarakat serta perkembangan informasi, menyebabkan Perpustakaan Umum Kota Cimahi harus siap mengantisipasi dan memfasilitasi kebutuhan tersebut.</p>\r\n<p>“Perpustakaan Umum Kota Cimahi sebagai salah satu sumber informasi, belajar, inspirasi,dan rekreasi masyarakat Kota Cimahi terutama di bidang pendidikan,” ujarnya.</p>\r\n<p>Sementara ini perpustakaan baru tersebut menyimpan sebanyak 12 ribu buku dengan beragam bidang keilmuan. Ke depannya, jumlah tersebut akan ditambah, bahkan pihaknya akan melengkapinya dengan e-library agar pembaca lebih mudah dalam mencari buku.</p>\r\n<p>Selain akan terus menambah koleksi buku, di perpustakaan baru itu juga akan digelar kegiatan-kegiatan lain yang dapat menunjang fungsi utamanya. Sehinga dapat lebih menumbuhkan daya tarik dan minat baca masyarakat dengan datang ke perpustakaan.</p>\r\n<p>“Di perpustakaan itu juga sudah memiliki fasilitas pendukung sepeti Ruang Baca, Ruang Anak, AC, Internet, Komputer, dan Wifi (Hotspot Area),” katanya.<b>(jabar.tribunnews.com)</b></p>\r\n<p>&nbsp;</p>\r\n</div>', '2014-10-06 11:51:13', 1);
